import React from'react';

const SignUp = () => {
    return(
        <div className='signUp'>
            <h1 className='signUp__title'>SignIn</h1>
            <form>
                <input type='email' placeholder='Email or phone number' />
                <input type='password' />
                <button type='submit'>SignIn</button>
            </form>
            <h5><span className='signUp__new'>New to Netflix?</span> <span className='signUp__now'>Sign up now</span></h5>
        </div>
    )
}

export default SignUp;
